		private static string GetParent(TreeNode[] example)
		{
			var childNodes = new HashSet<string>(example.SelectMany(node => node.Children));
			var rootNodes = new HashSet<string>(example.Select(node => node.Name));
			rootNodes.ExceptWith(childNodes);
			return rootNodes.Single();
		}

		private static int GetCorrectWeightOfUnbalacedProgram(TreeNode[] input)
		{
			var tree = input.ToDictionary(node => node.Name);
			var parent = tree[GetParent(input)];
			return parent.GetCorrectWeightOfUnbalacedProgram(tree);
		}
