	class TreeNode
	{
		public string Name { get; set; }
		public int Weight { get; set; }
		public string[] Children { get; set; }

		public int WeightSum { get; set; }
		public bool Balanced { get; set; }

		public TreeNode(string name, int weight, string[] children = null)
		{
			Name = name ?? throw new ArgumentNullException(nameof(name));
			Weight = weight;
			Children = children ?? Array.Empty<string>();
		}

		public int GetCorrectWeightOfUnbalacedProgram(Dictionary<string, TreeNode> tree)
		{
			var children = this.Children.Select(c => tree[c]).ToList();
			this.WeightSum = this.Weight;
			this.Balanced = true;

			int result = -1;
			foreach (var child in children)
			{
				result = child.GetCorrectWeightOfUnbalacedProgram(tree);
				if (result != -1)
				{
					break;
				}

				this.WeightSum += child.WeightSum;
				this.Balanced &= child.WeightSum == children[0].WeightSum;
			}

			if (result == -1 && !this.Balanced)
			{
				var childrenByWeight = children.GroupBy(c => c.WeightSum).ToList();

				var correctGroup = childrenByWeight.Single(group => group.Count() != 1);
				var wrongGroup = childrenByWeight.Single(group => group.Count() == 1);

				int correctSum = correctGroup.Key;
				int wrongSum = wrongGroup.Key;

				result = wrongGroup.Single().Weight - wrongSum + correctSum;
			}

			return result;
		}
	}
